import React, { useState } from 'react';
import { Modal } from '@consta/uikit/Modal';
import { TextField } from '@consta/uikit/TextField';
import { Button } from '@consta/uikit/Button';
import { Grid, GridItem } from '@consta/uikit/Grid';

interface Customer {
  id: number;
  customerCode: string;
  customerName: string;
  customerInn: string;
  customerKpp: string;
  customerLegalAddress: string;
  customerPostalAddress: string;
  customerEmail: string;
  customerCodeMain: string | null;
  isOrganization: boolean;
  isPerson: boolean;
}

type Props = {
  isOpen: boolean;
  onClose: () => void;
  handleSaveCustomer: (customer: Customer) => void;
};

const AddCustomerModal: React.FC<Props> = ({
  isOpen,
  onClose,
  handleSaveCustomer,
}) => {
  const [newCustomer, setNewCustomer] = useState<Customer>({
    id: 0,
    customerCode: '',
    customerName: '',
    customerInn: '',
    customerKpp: '',
    customerLegalAddress: '',
    customerPostalAddress: '',
    customerEmail: '',
    customerCodeMain: null,
    isOrganization: false,
    isPerson: false,
  });

  const handleInputChange =
    (field: keyof Customer) => (event: React.ChangeEvent<HTMLInputElement>) => {
      setNewCustomer((prev) => ({
        ...prev,
        [field]: event.target.value,
      }));
    };

  const handleSubmit = () => {
    handleSaveCustomer(newCustomer);
  };

  return (
    <Modal isOpen={isOpen} onClose={onClose} style={{ maxWidth: '800px' }}>
      <div>
        <h3>Добавление заказчика</h3>
        <Grid cols={3} gap="m">
          <GridItem>
            <TextField
              label="Наименование"
              value={newCustomer.customerName}
              onChange={handleInputChange('customerName')}
              placeholder="Введите наименование"
            />
          </GridItem>
          <GridItem>
            <TextField
              label="ИНН"
              value={newCustomer.customerInn}
              onChange={handleInputChange('customerInn')}
              placeholder="Введите ИНН"
            />
          </GridItem>
          <GridItem>
            <TextField
              label="КПП"
              value={newCustomer.customerKpp}
              onChange={handleInputChange('customerKpp')}
              placeholder="Введите КПП"
            />
          </GridItem>
          <GridItem>
            <TextField
              label="Юридический адрес"
              value={newCustomer.customerLegalAddress}
              onChange={handleInputChange('customerLegalAddress')}
              placeholder="Введите юридический адрес"
            />
          </GridItem>
          <GridItem>
            <TextField
              label="Почтовый адрес"
              value={newCustomer.customerPostalAddress}
              onChange={handleInputChange('customerPostalAddress')}
              placeholder="Введите почтовый адрес"
            />
          </GridItem>
          <GridItem>
            <TextField
              label="Электронная почта"
              value={newCustomer.customerEmail}
              onChange={handleInputChange('customerEmail')}
              placeholder="Введите электронную почту"
            />
          </GridItem>
          <GridItem>
            <TextField
              label="Вышестоящий контрагент"
              value={newCustomer.customerCodeMain ?? ''}
              onChange={handleInputChange('customerCodeMain')}
              placeholder="Введите код вышестоящего контрагента"
            />
          </GridItem>
        </Grid>
        <div style={{ marginTop: '16px' }}>
          <Button label="Добавить" onClick={handleSubmit} />
          <Button
            label="Отмена"
            onClick={onClose}
            style={{ marginLeft: '8px' }}
          />
        </div>
      </div>
    </Modal>
  );
};

export default AddCustomerModal;
